import { View, StyleSheet } from "react-native";
import StartGame from "./src/screens/StartGame/StartGame";

export default function App() {
  return (
    <View style={styles.root}>
      <StartGame />
    </View>
  );
}

const styles = StyleSheet.create({
    root: {
        backgroundColor: "#ddb52f"
    }
})
